import React, {useEffect,useState} from 'react';
import type {Node} from 'react';
import {
    Image,
    SafeAreaView,
    ScrollView,
    StatusBar,
    StyleSheet,
    Text, TouchableOpacity,
    useColorScheme,
    View,
} from 'react-native';
import {
    ViroARScene,
    ViroText,
    ViroConstants,
    ViroARSceneNavigator
} from '@viro-community/react-viro'
import { BASE_API_PORT_PRODUCT, BASE_API_URL } from "../Config";
import { AirbnbRating } from "react-native-ratings";


const DetailProductComponent = (props) =>{

    const [product, setProduct] = useState({ });
    const [price,setPrice]= useState(0)
    const [stock,setStock]= useState(0)
    const [color,setColor]= useState("")
    const [description,setDescription]= useState("")
    console.log(props)
    function api() {
        return new Promise((resolve, reject) => {
            fetch(
              BASE_API_URL + ':' + BASE_API_PORT_PRODUCT + '/api/products/' + props.route.params.id,
              {
                  method: 'GET',
                  headers: {
                      Accept: 'application/json',
                      'Content-Type': 'application/json',
                  },
              },
            )
              .then(r => r.json())
              .then(r => {
                  console.log(r);
                  resolve(r);
              })
              .catch(error => {
                  console.error(error);
                  reject(error);
              });
        });
    }

    useEffect(() => {
        api().then(data => {
            console.log("data")
            console.log(data)
            console.log("data")
            setPrice(data.details.price)
            setDescription(data.details.description)
            setStock(data.stock)
            setColor(data.details.color)
            setProduct(data);
        });

    }, [props]);



    const RenderItem = () => {
        let name = product.name;


        return (
          <View style={styles.product}>
              <View style={styles.titleUnderline}>
                  <Text style={styles.titleName}>{name} </Text>
              </View>
              <Text
                style={{
                    fontSize: 22,
                    textAlign: 'center',
                    marginTop: 10,
                    marginBottom: 10,

                }}>
                  {name}
              </Text>
              <View style={styles.productDetails}>
                  <TouchableOpacity onPress={goToArVisualisation}>
                      <Image
                        style={styles.tinyLogo}
                        source={{
                          uri:'data:image/jpeg;base64,'
                        }}
                      />
                  </TouchableOpacity>

                  <View style={styles.productText}>
                      <View style={styles.titleUnderline}>
                          <Text style={styles.title}>Couleur</Text>
                      </View>
                      <View style={{backgroundColor:color, padding:40, margin:5, borderRadius:15,borderWidth:0.7}}></View>
                      <View style={styles.titleUnderline}>
                          <Text style={styles.title}>Stock</Text>
                      </View>
                      <Text>stock</Text>

                      <Text style={styles.title}>Prix: {price}   </Text>
                  </View>
              </View>
              <View style={styles.titleUnderline}>
                  <Text style={styles.titleDescription}>Description</Text>
              </View>
              <Text style={styles.productDescription}> {description}</Text>
            <AirbnbRating
              count={11}
              reviews={["Terrible", "Bad", "Meh", "OK", "Good", "Hmm...", "Very Good", "Wow", "Amazing", "Unbelievable", "Jesus"]}
              defaultRating={8}
              size={20}
              isDisabled={true}
            />
          </View>
        );
    };

    function goToArVisualisation(){
        props.navigation.navigate("ARVisualisation")
    }

    return(
      <View style={{alignItems: 'center', justifyContent: 'center'}}>
          <RenderItem />
      </View>
    )
}
const styles = StyleSheet.create({
  tinyLogo: {
    height: 230,
    width: 200,
    borderRadius: 15,
    borderColor: 'grey',
    marginLeft: 15,
    marginBottom: 15,
    marginTop: 15,
  },
  title: {
    fontSize: 16,
    fontWeight: 'bold',
    marginTop: 10,
    lineHeight: 20,

  },
  titleDescription: {
    fontSize: 18,
    fontWeight: 'bold',
    marginTop: 10,
    lineHeight: 20,
    textAlign: 'center',
  },
  titleName: {
    fontSize: 24,
    fontWeight: 'bold',
    marginTop: 30,
    textAlign: 'center',
  },
  titleUnderline: {
    borderBottomWidth: 1,
  },
  product: {
    display: 'flex',
    flexDirection: 'column',
    backgroundColor:'white',
    height:'100%'
  },
  productDetails: {
    display: 'flex',
    flexDirection: 'row',
    borderWidth: 1,
    borderRadius: 15,
    margin: 5,
  },
  productText: {
    borderLeftWidth:0.7,
    display: 'flex',
    flexDirection: 'column',
    gap: 10,
    margin: 15,
    padding:15,
  },
  productDescription: {
    margin: 5,
    padding: 5,
    fontSize:15,
  },
});

export default DetailProductComponent
